import * as React from "react";
import { styled } from "@mui/material/styles";

import Table from "@mui/material/Table";
import Box from "@mui/material/Box";
import Grid from "@mui/material/Grid";

import Divider from "@mui/material/Divider";

import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";
import Typography from "@mui/material/Typography";

import Button from "@mui/material/Button";

import NavigateNextRoundedIcon from "@mui/icons-material/NavigateNextRounded";

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === "dark" ? "#1A2027" : "#fff",
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: "center",
  color: theme.palette.text.secondary,
}));

function createData(handWash, exterior, interior, deluxe) {
  return { handWash, exterior, interior, deluxe };
}

const carRows = [createData("$15", "$30", "$35", "$130")];
const truckRows = [createData("$15", "$30", "$35", "$130")];
const extTruckRows = [createData("$15", "$30", "$35", "$130")];
const vanRows = [createData("$15", "$30", "$35", "$130")];
const smallSuvRows = [createData("$15", "$30", "$35", "$130")];
const midSuvRows = [createData("$15", "$30", "$35", "$130")];
const fullSuvRows = [createData("$15", "$30", "$35", "$130")];

export default function BasicTable() {
  return (
    <Box sx={{ flexGrow: 1 }}>
      <Divider>
        <Typography
          sx={{ display: { xs: "none", sm: "none", md: "flex", xl: "none" } }}
          variant="h2"
        >
          Additional Services
        </Typography>
        <Typography
          sx={{ display: { xs: "none", sm: "flex", md: "none", xl: "none" } }}
          variant="h4"
        >
          Additional Services
        </Typography>
        <Typography
          sx={{ display: { xs: "flex", sm: "none", md: "none" } }}
          variant="h6"
        >
          Additional Services
        </Typography>
      </Divider>
      <Grid
        container
        spacing={2}
        direction="row"
        justifyContent="center"
        alignItems="center"
      >
        {/*//=========== GRID BOX START =================================> */}
        <Grid item xs={12} md={3.5}>
          <Item sx={{ bgcolor: "primary.main", color: "white" }}>
            <Divider>
              <Typography
                variant="h6"
                sx={{
                  fontWeight: 700,
                }}
              >
                Headlight Restoration
              </Typography>
            </Divider>
            <Grid
            sx={{bgcolor: "primary.light"}}
            >
            <Typography
                variant="h6"
                sx={{
                  fontWeight: 700,
                }}
              >
                $80
              </Typography>
              </Grid>
          </Item>
        </Grid>



        {/*//=============== GRID END GOES TO BOTTOM  =====================> */}
      </Grid>
    </Box>
  );
}
